        float x1dif_tRe_1b = x1dif * t1Re_1b;
        float x1sum_tRe_1b = x1sum * t1Re_1b;
          

        float t1Re_1b2b = 0x1.4e7ae8p-1f;
        float t1Re_1b2d = 0x1.1517a8p-2f; 

        float x3dif_tRe_1b2b = x3dif * t1Re_1b2b;
